    false,nt"url": null,nt"notes": "This digital data set provides an inventory
    of Federal Emergency Management Agency (FEMA) Flood Insurance Studies (FIS) that
    have been conducted for communities and counties in Kansas as of July 1, 1996. Each
    study location is represented by a point that was digitized from 1:24,000-scale
    U.S. Geological Survey topographic quadrangles. This digital inventory was produced
    in cooperation with the Kansas Water Office and was funded in part from State Water
    Plan funds.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
